      "artistLocation": "ARG-CHILE",
      "artistCompany": "",
      "bio": "Ricardo Vega y Karen Forcano son los bailarines latinos m√°s conocidos a \nnivel global! Conforman la actual pareja Nonacampeona Mundial de Salsa\n estilo Cabaret. Con tan solo 28 y 29 a√±os son la pareja latina poseedora \ncon m√°s t√≠tulos mundiales y nacionales.\n\n\nEllos combinan elementos de baile acrob√°ticos con la danza latina, lo que hace que llame la atenci√≥n del mundo entero. bailan juntos profesionalmente desde el a√±o 2009.Karen fue motivada por su madre, quien era bailarina de ballet.\n\nKaren comenz√≥ con ballet cl√°sico a los 6 a√±os y cuando ten√≠a 7, su madre tom√≥ clases de salsa y merengue, situaci√≥n que a ella le gust√≥ mucho m√°s y fue as√≠ que desde entonces comenz√≥ a prepararse profesionalmente en los bailes latinos en diferentes escuelas de argentina y con los mejores profesionales del estilo hasta la actualidad.\n\nRicardo, a su vez, comparte esta pasi√≥n con toda su familia, ya que fue inspirado por sus abuelos que eran bailarines de tango escenario; inici√°ndose a los 7 a√±os en el ballet cl√°sico en la mejor escuela del pa√≠s (teatro municipal de Santiago), hasta los 15 a√±os, tambi√©n se desenvolvi√≥ adquiriendo clases en las reconocidas academias de danza contempor√°nea, jazz, hip hop y otros ritmos.\n\nKaren y Ricardo se conocen en Chile el 2003, en el 2004 comenzaron a bailar espor√°dicamente para diferentes concursos, eventos y programas televisivos. Pero desde el 2009 cuando Ricardo viaja con Karen a su primer congreso de salsa juntos; se hicieron pareja de baile definitiva y se enfocaron profesionalmente en la salsa y los ritmos latinos.\n\nActualmente Karen y Ricardo ya con m√°s de 15 t√≠tulos nacionales e internacionales ganados, han viajado por todos los continentes compitiendo, ense√±ando y mostrando su arte en los diferentes congresos de baile alrededor del mundo.\n\nHan visitado pa√≠ses tan diferentes como Australia, Israel, Turqu√≠a, Francia, Espa√±a, Nueva Zelanda, M√©xico, Jap√≥n, Singapur y EEUU. Actualmente tienen sus propios teams y compa√±√≠a bailando sus coreograf√≠as, ‚ÄúKaren y Ricardo Enterteiment‚Äù en m√°s de 12 pa√≠ses, escuela virtual para aprender a bailar salsa, y una tienda con merchandising que incluye: videos, camisetas, bolsas para zapatos de baile y cinta para pegar trajes de baile.\nSu destacada participaci√≥n en el programa World Of Dance season 2, emitido por la cadena Norteamericana NBC, los ha llevado a consolidar su fama fuera del mundo del baile.\n\nEn 2019 fueron nominados a los reconocidos premios estadounidenses ‚ÄòEmmys Awards‚Äô como mejores core√≥grafos por tres de sus rutinas de danza. Tambi√©n ese mismo a√±o, ganaron el reconocido premio a la mejor coreograf√≠a de TV Show en ‚ÄòWorld Chorography Awards‚Äô, LA. ¬°Ellos se han convertido en personalidades destacadas a nivel mundial!",
