    "Adolfo & Tania": {
      "fullName": "Adolfo & Tania",
      "artistLocation": "NEW YORK",
      "artistCompany": "",
      "insta": "adolfoindacochea",
      "bio": "Adolfo Indacochea, a world-renowned dancer with over 23 years of international experience, is celebrated for his explosive and unique mambo style. Born in Lima, Peru, he mastered salsa in Mexico before conquering the New York Mambo scene. Adolfo‚Äôs journey includes performing at prestigious venues like Lincoln Center, sharing the stage with music icons, and partnering with acclaimed dancers.Tania Cannarsa, born in Sri Lanka and raised in Italy, brings a distinctive mambo style with a background in classical dance. As a principal dancer in Adolfo Indacochea‚Äôs Latin Soul Dancers, she has crafted mesmerizing mambo pieces.Their passion for mambo extends to teaching, with Adolfo‚Äôs expertise covering timing, styling, shines, and more. Together with Tania, they‚Äôve traveled the world, captivating audiences and imparting the joy and tradition of mambo. Join them on a journey of rhythm, style, and pure dance magic!#AdolfoIndacochea #TaniaCannarsa #MamboLegends #DanceMagic #LatinSoulDancers\n\nIs an explosive and energetic dancer who is known all around the world for his smooth and unique style. This unique style combines traditional mambo with elements of jazz/modern, flamenco, and ballroom dances. His sense of musicality and flow is evident through his choreography and improvisations‚Ä¶\n\nBorn and raised in Lima, Peru, Adolfo moved to Monterrey, Mexico when he was 19 to study Industrial Engineering and began taking salsa classes ‚ÄúOn 1‚Ä≥ as a hobby in 2001. In less than two months, his talent was quickly recognized by Adrian Arellano, a well-known performer and instructor in Mexico, and was asked to be one of the founding members of Salzumba Dance Company, he later formed his first dance company named ‚ÄúMamboss,‚Äù which is now recognized as one of the biggest salsa companies and schools in Mexico. In search of developing his talent, Adolfo moved to San Antonio, Texas in January of 2004 and was invited to join and teach with Semeneya Dance Company as well as work independently with his former partner Claudia Vazques. It wasn‚Äôt until 2003 that his passion for dancing ‚ÄúOn 2‚Ä≥ developed after seeing Eddie Torres and his Dancers perform at the New York Salsa Congress that year. He taught himself how to dance ‚ÄúOn 2,‚Äù New York Style, with the dream of becoming an Eddie Torres Dancer within the next few years.\n\nAdolfo moved to New York City in September of 2004 and was invited to be the exclusive partner of Amanda Estilo in addition to training with Karisma Dancers, directed by his friend Victor Mayovanex. It wasn‚Äôt until December 2004 that his dream of becoming an Eddie Torres Dancer was fulfilled. His mentor Eddie Torres discovered his talent and potential instantly and invited Adolfo to join one of the most prestigious teams in the world. After 8 months, Adolfo began to perform exclusively with Jessica Ortiz at the same time becoming one of the elite dancers in the Eddie Torres Company and rising to be one of the newest stars in the New York Mambo scene. After 2 years, his mentor Eddie Torres gave him his blessing to move on and to strive to be one of the top mambo dancers in the world.",
      "shortBio": "",
      "facebook": "",
      "portrait": "adolfo_-_tania"
    },
